// ret = a//b
void div(mpz_t ret, mpz_t a, mpz_t b)
{
    mpz_set_ui(ret, 0);
    mpz_t a_copy, b_copy;
    mpz_init(a_copy);
    mpz_init(b_copy);
    mpz_set(a_copy, a);
    mpz_set(b_copy, b);

    mpz_t count, tmp;
    mpz_init(count);
    mpz_init(tmp);

aa1:
    if (mpz_cmp(a_copy, b_copy) >= 0)
    {
        mpz_set_ui(count, 1);
        mpz_set(tmp, b_copy);
        mpz_mul_ui(tmp, tmp, 2);
    bb1:
        if (mpz_cmp(a_copy, tmp) >= 0)
        {
            mpz_mul_ui(count, count, 2);
            mpz_mul_ui(tmp, tmp, 2);
            goto bb1;
        }
        else
        {
            goto cc1;
        }
    cc1:
        mpz_add(ret, ret, count);
        mpz_mul(tmp, b_copy, count);
        mpz_sub(a_copy, a_copy, tmp);
        if (mpz_cmp(a_copy, b_copy) >= 0)
            goto aa1;
        else
        {
            goto dd1;
        }
    }
dd1:
    mpz_clear(a_copy);
    mpz_clear(b_copy);
    mpz_clear(count);
    mpz_clear(tmp);
}

// ax + by = gcd(a, b)
void exgcd(mpz_t a, mpz_t b, mpz_t x, mpz_t y)
{
    mpz_t m, n, t, tmp1, a_copy, b_copy;
    mpz_init(m);
    mpz_init(n);
    mpz_init(t);
    mpz_init(tmp1);
    mpz_init(a_copy);
    mpz_init(b_copy);
    mpz_set(a_copy, a);
    mpz_set(b_copy, b);
    mpz_set_ui(m, 0);
    mpz_set_ui(n, 1);
    mpz_set_ui(x, 1);
    mpz_set_ui(y, 0);

aa2:
    if (mpz_cmp_ui(b_copy, 0))
    {
        mpz_set(t, m); // t = m
        div(tmp1, a_copy, b_copy);
        mpz_mul(tmp1, tmp1, m);
        mpz_sub(m, x, tmp1); // m = x - a/b*m
        mpz_set(x, t);       // x = t

        mpz_set(t, n); // t = n
        div(tmp1, a_copy, b_copy);
        mpz_mul(tmp1, tmp1, n);
        mpz_sub(n, y, tmp1); // n = y - a/b*n
        mpz_set(y, t);       // y = t

        // a = b, b = a%b
        mpz_set(t, b_copy);
        mpz_mod(b_copy, a_copy, b_copy);
        mpz_set(a_copy, t);
        if (mpz_cmp_ui(b_copy, 0))
        {
            goto aa2;
        }
        else
        {
            goto bb2;
        }
    }
bb2:
    if (mpz_cmp_ui(x, 0) < 0)
    {
        mpz_add(x, x, b);
        if (mpz_cmp_ui(x, 0) < 0)
        {
            goto bb2;
        }
        else
        {
            goto cc2;
        }
    }
cc2:
    if (mpz_cmp_ui(x, 0) < 0)
    {
        mpz_add(x, x, b);
        if (mpz_cmp_ui(x, 0) < 0)
        {
            goto bb2;
        }
        else
        {
            goto cc2;
        }
    }
}

