void WBenc(mpz_t etx, mpz_t e)
{
    unsigned char a[32], c[64];
    mpz_export(a, NULL, 1, 32, 1, 0, e);
    int i, j;
    unsigned int C[64], tt;
    memset(C, 0, sizeof(C));
    for (i = 0; i < 16; i++)
    {
        tt = a[31 - i];
        a[31 - i] = a[i];
        a[i] = tt;
    }
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 32; j++)
        {
            C[i + j] += cc[j][a[i]] - dd[j * 32 + a[i]];
        }
    }
    for (i = 0; i < 64; i++)
    {
        c[i] = ee[a[i % 32]][C[i] % 256];
        if (i != 63)
        {
            C[i + 1] += C[i] / 256;
        }
    }
    mpz_import(etx, 64, 1, 1, 1, 0, c);
}

void WBdec(mpz_t et, mpz_t etx, mpz_t e)
{
    unsigned char a[32], c[64], ccc[64], tt;
    mpz_export(a, NULL, 1, 32, 1, 0, e);
    mpz_export(c, NULL, 1, 64, 1, 0, etx);
    int i;
    for (i = 0; i < 32; i++)
    {
        tt = c[63 - i];
        c[63 - i] = c[i];
        c[i] = tt;
    }
    for (i = 0; i < 64; i++)
    {
        ccc[i] = ff[a[i % 32]][c[i]];
    }
    mpz_import(et, 64, 1, 1, 1, 0, ccc);
    mpz_mod(et, et, n);
}

void ECDSA_256_sign(unsigned char sig[64], const unsigned char hash[32])
{
    mpz_init(a);
    mpz_init(b);
    mpz_init(p);
    mpz_init(n);
    mpz_init(Q_x);
    mpz_init(Q_y);

    mpz_set_str(a, "FFFFFFFF00000001000000000000000000000000FFFFFFFFFFFFFFFFFFFFFFFC", 16);
    mpz_set_str(b, "5AC635D8AA3A93E7B3EBBD55769886BC651D06B0CC53B0F63BCE3C3E27D2604B", 16);
    mpz_set_str(p, "FFFFFFFF00000001000000000000000000000000FFFFFFFFFFFFFFFFFFFFFFFF", 16);
    mpz_set_str(n, "FFFFFFFF00000000FFFFFFFFFFFFFFFFBCE6FAADA7179E84F3B9CAC2FC632551", 16);
    mpz_set_str(G_x, "6B17D1F2E12C4247F8BCE6E563A440F277037D812DEB33A0F4A13945D898C296", 16);
    mpz_set_str(G_y, "4FE342E2FE1A7F9B8EE7EB4A7C0F9E162BCE33576B315ECECBB6406837BF51F5", 16);

    // precompute parameters
    mpz_t tmp, tmp2;
    mpz_t RA_x, RA_y;
    mpz_t kAt_inv;
    mpz_t otxS;
    mpz_init(tmp);
    mpz_init(tmp2);
    mpz_init(RA_x);
    mpz_init(RA_y);
    mpz_init(kAt_inv);
    mpz_init(otxS);

    mpz_set_str(RA_x, "117a6aa0cb8179b4e68efd136097e18d47709eb241ec5d29ee88404992518c22", 16);
    mpz_set_str(RA_y, "9591353b3f8ceb8143fdf0d9746367a050b03ee01f2efdb4ba6ee6acd5cfa91", 16);
    mpz_set_str(kAt_inv, "75aef771ba244a77312d993fb9045db8b1269fe22746593ef49aa96e8c4b4a33", 16);
    mpz_set_str(otxS, "11318ad570303062b9a36dc026715e974271be095702396b3686e9561a297457", 16);

    mpz_t r;
    mpz_t s, s1;
    mpz_t e;
    mpz_t f11, f22; // f11、f22表示h(e)
    mpz_t kS, otxA;

    mpz_init(r);
    mpz_init(s);
    mpz_init(s1);
    mpz_init(e);
    mpz_init(f11);
    mpz_init(f22);
    mpz_init(kS);
    mpz_init(otxA);

    mpz_import(e, 32, 1, 1, 1, 0, hash);

    // 3.(a)
    WBenc(kS, e);

    // 3.(b)、(c)
    mpz_set_str(otxA, "1a879c5026dd8c4a5894cd083e3623c70c129d7a6831ec167c5d191313ef5627", 16);

    // 4.
    WBdec(tmp, kS, e);
    mpz_mul(tmp, tmp, kS); // tmp = WBdec(WBenc(e))*WBenc(e)

    R(tmp2, e);                // tmp2 = h(e)
    mpz_mul(tmp2, tmp2, otxS); // tmp2 = h(e)*otxS

    mpz_add(tmp, tmp, tmp2); // tmp = WBdec(WBenc(e))*WBenc(e) + h(e)*otxS

    R(tmp2, e);                // tmp2 = h(e)
    mpz_mul(tmp2, tmp2, otxA); // tmp2 = h(e)*otxA

    mpz_add(tmp, tmp, tmp2); // tmp = WBdec(WBenc(e))*WBenc(e) + h(e)*otxS + h(e)*otxA

    mpz_mul_mod(s1, kAt_inv, tmp, n); // s1 = kAt_inv*(WB(e) + f11*otxS + f22*otxA*kS) % n

    // 5.
    WBenc(tmp, e);               // tmp = kS
    mpz_mul(tmp, tmp, tmp);      // tmp = kS2
    exgcd(tmp, n, tmp2, s);      // tmp2 = kS2_inv
    mpz_mul_mod(s, s1, tmp2, n); // s = s1*kS2_inv

    WBenc(tmp, e);                    // tmp = kS
    kpoint(tmp2, r, tmp, RA_x, RA_y); // tmp2 = xR
    mpz_mod(r, tmp2, n);

     //gmp_printf("r = %Zx\n", r);
     //gmp_printf("s = %Zx\n", s);

    mpz_export(sig, NULL, 1, 32, 1, 0, r);
    mpz_export(sig + 32, NULL, 1, 32, 1, 0, s);

    mpz_clear(tmp);
    mpz_clear(tmp2);
    mpz_clear(RA_x);
    mpz_clear(RA_y);
    mpz_clear(kAt_inv);
    mpz_clear(otxS);

    mpz_clear(r);
    mpz_clear(s);
    mpz_clear(s1);
    mpz_clear(e);
    mpz_clear(f11);
    mpz_clear(f22);
    mpz_clear(otxA);
    mpz_clear(kS);
}

#include <sys/times.h>
#include <unistd.h>
#include <signal.h>
#include <stdio.h>

#define TM_START        0
#define TM_STOP         1

#define START        0
#define STOP         1

int run = 0;
unsigned char h[32]={0}, sig[64]={0};

void alarmed(int sig)
{
    // 注册一个计时器
    signal(SIGALRM, alarmed); 
    run = 0;
}

double app_tminterval(int stop)
{
    double ret = 0;
    struct tms rus;
    clock_t now = times(&rus);
    static clock_t tmstart;

    // if (usertime)
    //     now = rus.tms_utime;

    if (stop == TM_START) {
        tmstart = now;
    } else {
        long int tck = sysconf(_SC_CLK_TCK);
        ret = (now - tmstart) / (double)tck;
    }
    return ret;
}

// s为STOP时，返回间隔时间
double Time_F(int s)
{
    double ret = app_tminterval(s);  // 返回
    if (s == STOP)
        alarm(0);  // 停止闹钟
    return ret;
}


